import maya

maya.stringTable['y_maya_app_renderSetup_model_fileLoadMonitor.kErrorCombiningLegacyToNew'] = u'レンダリング設定を使用しているシーンに旧式のレンダー レイヤを含むファイルをロードしようとしています。この組み合わせはサポートされていないため、予期しない動作になる可能性があります。'
maya.stringTable['y_maya_app_renderSetup_model_fileLoadMonitor.kErrorCombiningNewToLegacy'] = u'旧式のレンダー レイヤを使用しているシーンに、レンダリング設定ノードを含むファイルをロードしようとしています。この組み合わせはサポートされていないため、予期しない動作になる可能性があります。'
maya.stringTable['y_maya_app_renderSetup_model_fileLoadMonitor.kErrorSwitchToRenderLayer'] = u'このファイルには旧式のレンダー レイヤが含まれていて、Maya は現在レンダリング設定モードです。この組み合わせはサポートされていません。[プリファレンス]ウィンドウの[レンダリング]セクションにある[優先レンダリング設定システム]ドロップダウン リストで、旧式のレンダー レイヤ モードに切り替えることができます。'
maya.stringTable['y_maya_app_renderSetup_model_fileLoadMonitor.kErrorSwitchToRenderSetup'] = u'このファイルにはレンダリング設定ノードが含まれていて、Maya は現在旧式のレンダー レイヤ モードです。この組み合わせはサポートされていません。[プリファレンス]ウィンドウの[レンダリング]セクションにある[優先レンダリング設定システム]ドロップダウン リストで、レンダリング設定モードに切り替えることができます。'
maya.stringTable['y_maya_app_renderSetup_model_fileLoadMonitor.kFileSwitchToDefaultRenderLayer'] = u' ファイルは、アクティブなレイヤとして設定された既定のレンダー レイヤとともに開かれています。'
maya.stringTable['y_maya_app_renderSetup_model_fileLoadMonitor.kLightVisibilityChangedStr'] = u"このシーンは、旧バージョンの Maya のシーンであり、無効なライト コレクションが含まれています。ライト コレクションの無効化のサポートが廃止されたため、ライト '%s' の表示が変更された可能性があります。"
maya.stringTable['y_maya_app_renderSetup_model_fileLoadMonitor.kWarningVisibleRenderLayer'] = u'このファイルは、レンダー レイヤが可視として設定された状態で保存されました。マスター レイヤが可視として設定されたファイルを保存してから、そのファイルを読み込む、または参照することをお勧めします。'
